import React from 'react'
import { useAuth } from "./auth";
function Profile() {
  const auth = useAuth()
  const handleLoguot = () => {
    auth.logout()
    navigate('/')
  }
  return (
    <>
    <div>Welcome {auth.user}</div>
    <button onClick={handleLoguot}>Logout</button>
    </>
  )
}

export default Profile
